import React from 'react';
import {NavLink} from "react-router-dom";

const Home = () => {
    return (
        <div className="homeblock">

            <div className="map">
                <h1>HOME</h1>
            </div>

            <div className="bottomNav">
                <NavLink to="/Professionals" className="bottomNavButtons"> Alle </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Fysiotherapie </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Oefenherapie </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Logopedie </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Ergotherapie </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Dietist </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Revalidatie </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Zorguitleen </NavLink>
                <NavLink to="/Professionals" className="bottomNavButtons"> Ziekenhuizen </NavLink>
            </div>

        </div>

    )
}

export default Home;
